package Vishwatech;

public class RelationalCompOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int s=10;
		int a=40;
		
		System.out.println(s==a);  //s is not eqaul to a ans=false
				
	    System.out.println(a>s);
		System.out.println(a>=s);
		System.out.println(a<=s);
		System.out.println(s!=a);
		System.out.println(a!=s);
		
		

	}

}
